import './App.css';
import logo from './logo.svg'; 

function App() {
  return (
    <div>
    <div className="App">
      <header className="App-header">
      <img src={logo} className="App-logo" alt="logo" />
        <p>
        <div className="sun">
          </div>
        </p>
      </header>
    </div>
    <div className="rectangle">
    </div>
    </div>
  );
}

export default App;
